import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Electronics" category link
    // Using getByRole is a robust way to find links by their accessible name.
    // We use .first() because there are multiple links with the same name.
    const electronicsLink = page.getByRole('link', { name: 'Electronics' }).first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });

    // Extract the href attribute for verification
    const linkHref = await electronicsLink.getAttribute('href');

    await electronicsLink.click();

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    return {
      success: true,
      action: "Navigated to the Electronics category by clicking the first 'Electronics' link.",
      extractedData: {
        clickedLinkHref: linkHref
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
